import React, { Component } from "react";
import Layout from "../components/MyLayout";

class Bloh extends Component {
  constructor(props) {
    super(props);
    this.state = {
      numBlogs: 0
    };
  }

  render() {
    return (
      <Layout page="Blog">
        <h1>
          This is the blog page. There are currently {this.state.numBlogs}{" "}
          posts.
        </h1>
      </Layout>
    );
  }
}

export default Blog;
